import axios from 'axios'
import React from 'react'
import { InfinitySpin } from 'react-loader-spinner'
import { useQuery } from 'react-query'

export default function AllOrders() {
    let {isLoading , data } = useQuery('allOrders',getAllOrders)
    async function getAllOrders(){
        let {data} = await axios.get (`https://ecommerce.routemisr.com/api/v1/orders`)
        console.log(data?.data[0].paymentMethodType);
    }
    return (
    <>
    {isLoading ? <>
        <div className="loading-page w-100 vh-100  d-flex justify-content-center align-items-center ">
          <InfinitySpin width="200" color="rgb(24, 7, 109)" />
        </div>
    
    </>: <div className='container'>
        <div className="row">
            
                {data?.data.map((order)=>{
                    console.log(order[0].paymentMethodType);
                <div key={order._id} className="col-md-9">
                    <h4>{order.paymentMethodType}</h4>

                </div>


                })}
        </div>
    </div>
    }

    
    
    
    
    </>
  )
}
